const type="HEADER_CONTENT_DATA_SUCCESS"
export function headerContentDataSuccess(headerContent) {
    return {
        type: type,
        payload: headerContent
    }
}

export function headerContentData(url) {
    return (dispatch) => {
        fetch(url)
            .then(
                response => {
                    if (!response.ok) {
                        throw new Error(response.statusText)
                    }
                    return response
                })
            .then(response => response.json())
            .then(headerContent => dispatch(headerContentDataSuccess(headerContent)))
    }
}
